import './app-info.css';

const AppInfo = ({musiciansValue}) => {
    return(
        <div className="app-info">
            <h1>Перечень музыкантов которые ничего</h1>
            <h2 onClick={musiciansValue}>Общее число музыкантов: </h2>
            <h2>Печеньку получат: </h2>
        </div>
    );
}

export default AppInfo;
